import React from "react";
import {
    Col,
    Row,
    FormGroup,
    Label,
    Button,
    ModalBody,
    ModalFooter,
    CustomInput,
    Input,
    Modal,
    ModalHeader
} from "reactstrap";
import Translate from "../../../Translate";
import jwt from "jwt-simple";
import SupplierDetails from "./supplierDetails";
import {FileText} from "react-feather";

const SupplierModal = (props) => {
    function modalBodyContent() {
        if (props.type === "delete") {
            return (
                <ModalBody>Դուք համոզված ե՞ք ջնջել</ModalBody>
            )
        } else {

            return (

                <ModalBody>
                    <form>
                        <h6 className="form-section"><FileText size={20} color="#212529"/> Requirements</h6>

                        <FormGroup row>
                            <Label for="eventRegInput1" sm={3}>Անվանում:</Label>
                            <Col sm={9}>
                                <Input type="text" id="eventRegInput1" name="fullname"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput2" sm={3}>Հ/Հ:</Label>
                            <Col sm={9}>
                                <Input type="text" id="eventRegInput2" name="title"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput3" sm={3}>ՀՎՀՀ:</Label>
                            <Col sm={9}>
                                <Input type="text" id="eventRegInput3" name="company"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput4" sm={3}>Հասցե:</Label>
                            <Col sm={9}>
                                <Input type="email" id="eventRegInput4" name="email"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput5" sm={3}>Բանկ:</Label>
                            <Col sm={9}>
                                <Input type="tel" id="eventRegInput5" name="contact"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput5" sm={3}>Տնօրեն:</Label>
                            <Col sm={9}>
                                <Input type="tel" id="eventRegInput5" name="contact"/>
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <Label for="eventRegInput5" sm={3}>Հեռ:</Label>
                            <Col sm={9}>
                                <Input type="tel" id="eventRegInput5" name="contact"/>
                            </Col>
                        </FormGroup>

                    </form>

                </ModalBody>
            )

        }

    }

    return (
        <React.Fragment>
            <Modal isOpen={props.modal[props.type]} toggle={() =>{ props.toggleModal(props.type)}} size="lg">
                <ModalHeader toggle={() => {props.toggleModal(props.type)}}><Translate
                    name={props.type + "supplier"}/></ModalHeader>
                {modalBodyContent()}
                <ModalFooter>
                    <Button color="primary" type="submit" onClick={function () {
                        props.supplierActions(props.type, props.supplier);
                    }}>
                        <Translate name="confirm"/>
                    </Button>
                </ModalFooter>
            </Modal>

        </React.Fragment>
    );

};

export default SupplierModal;
